__NUXT_JSONP__("/page/5", (function(a,b,c,d,e,f,g,h,i,j,k,l,m,n,o,p,q,r){return {data:[{works:{contents:[{id:"paivittain-kukka-web",createdAt:f,updatedAt:"2022-01-09T00:35:33.235Z",publishedAt:f,revisedAt:f,title:"päivittäin kukka \u002F WEB SITE",category:[],release:l,thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002F329686b6044441cd99485968e47d8ff2\u002Fpaivittain_1.jpg",height:b,width:c},overview:"「日々を楽しくするヒント」をテーマにしたpäivittäin kukkaのブログサイトを制作しました。\n\n更新のしやすさを配慮して、WordPressを使用したレスポンシブWebデザインで構築しました。"},{id:"paivittain-kukka-logo",createdAt:g,updatedAt:"2022-01-09T00:35:36.957Z",publishedAt:g,revisedAt:g,title:"päivittäin kukka \u002F LOGO DESIGN",category:[],release:l,thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002F8610befc19b744aab8f7e7916858102d\u002Fpaivittainlogo_1.jpg",height:b,width:c},overview:"「日々を楽しくするヒント」をテーマにしたpäivittäin kukkaのロゴデザインを制作しました。"},{id:"gishinanki-web",createdAt:h,updatedAt:"2022-01-09T00:35:39.865Z",publishedAt:h,revisedAt:h,title:"疑心暗鬼 \u002F WEB SITE",category:[],release:i,thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002F28376580a73044bf8f038e413d5f6a91\u002Fgishinanki_1.jpg",height:b,width:c},overview:"沼情ゲーム部さん制作、退魔サバイバルカードゲーム「疑心暗鬼」のウェブサイトを制作させていただきました。\n\n「狐と鬼」をテーマに和風を意識した縦長1ページのデザインに仕上がりました。\n\nスマホ・タブレットに対応したレスポンシブWebデザインで構築しました。"},{id:"gishinanki-logo",createdAt:m,updatedAt:"2022-01-09T00:35:43.777Z",publishedAt:m,revisedAt:"2022-01-09T00:26:28.176Z",title:"疑心暗鬼 LOGO DESIGN",category:[],release:i,thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002F2cc3da490a5e468d9fe377106ce76d69\u002Fgishinanki_logo_b-800x500.png",height:d,width:a},overview:"沼情ゲーム部さん制作、退魔サバイバルカードゲーム「疑心暗鬼」のロゴを制作させていただきました。\n\n「狐と鬼」をキーワードにしたイラストとダイイングメッセージをイメージしたデザインに仕上がりました。\n\nコミックマーケット85 三日目にて頒布されました。"},{id:"among-the-soil-colobs",createdAt:n,updatedAt:o,publishedAt:n,revisedAt:o,title:"つちのなか \u002F colobs",category:[],release:i,thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002Fbe56075a43484a6da2604ca118a27837\u002Ftutinonaka_b2.jpg",height:527,width:850},overview:"打ち込み、弾き語り、生バンド、形態を問わず、都内を中心に活動されているcolobsさんのアルバム「詩的テクノロジーの憧憬」収録曲つちのなかの映像を制作させていただきました\n\n穏やかに土の中で春を待つイメージを自然で表現しました。",textlink1:"https:\u002F\u002Fwww.youtube.com\u002Fwatch?v=PmNvenPYeuA"},{id:"major-logo",createdAt:p,updatedAt:"2022-01-09T00:35:52.213Z",publishedAt:p,revisedAt:"2022-01-09T00:21:26.506Z",title:"MAJOR \u002F LOGO DESIGN",category:[],release:e,thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002Fd0ca2529a88d47a4bab48f96560f91a1\u002Fmajorlogo_1-800x500.jpg",height:d,width:a},overview:"銀座七丁目のBAR MAJOR様のロゴを制作させていただきました。\n\nカクテルをモチーフにしたマークと優雅な時間が流れる店内の空間を文字で表現したデザインを考えました。"},{id:"rekishinosaikisei-to-taisyouseinoyabure-flyer",createdAt:j,updatedAt:"2022-01-09T01:04:47.244Z",publishedAt:j,revisedAt:j,title:"歴史の再帰性と対称性の破れ \u002F FLYER DESIGN",category:[],release:e,thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002F58da093094444b1db1aab8585d0ee74a\u002Frekishi_b-800x500.jpg",height:d,width:a},overview:"高円寺U.F.O. CLUBで行われた「歴史の再帰性と対称性の破れ」のWebフライヤーを制作させていただきました。\n\nダークな闇のイメージと対象になる月を水彩を使って表現しました。",textlink1:"https:\u002F\u002Fufoclub.jp\u002F"},{id:"in-blooming-of-noises-flyer",createdAt:k,updatedAt:"2022-01-09T01:04:50.096Z",publishedAt:k,revisedAt:k,title:"in Blooming of Noises \u002F FLYER DESIGN",category:[],release:e,thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002F9954547afbb4435aa354df9055e086d2\u002Fblooming_b-800x500.jpg",height:d,width:a},overview:"ヒソミネで行われた「in Blooming of Noises」のWebフライヤーを制作させていただきました。\n\n花のような美しいノイズを水彩を使って表現しました。",textlink1:"http:\u002F\u002Fhisomine.com\u002F"},{id:"what-are-little-boys-made-of-mukaibi",createdAt:q,updatedAt:"2022-01-09T01:04:53.487Z",publishedAt:q,revisedAt:"2022-01-09T01:04:20.940Z",title:"What are little boys made of ? \u002F MUKAIBI",category:[],release:e,thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002F227022f424a64e51b0ded425115ad483\u002Fwhat_a_b22.jpg",height:496,width:a},overview:"M3-2013秋に参加しました。セルフカバーCD「What are little boys made of ?」とオリジナルTシャツを2種類制作しました。全5曲収録。"},{id:"route21",createdAt:r,updatedAt:"2022-01-09T01:04:57.004Z",publishedAt:r,revisedAt:"2022-01-09T00:58:00.904Z",title:"ROUTE 21",category:[],release:"2013-09-30T15:00:00.000Z",thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002F8baf4b2c5b2d4ac4afa7a4fdf5090cd3\u002Froot_21_b2.jpg",height:b,width:c},overview:"時間をテーマにした92年生まれが集まったコンピレーションCD「ROUTE 21」に参加させていただきました。。M3-2013秋(10\u002F27)P-15b itomaworks にて頒布されました。"}],totalCount:66,offset:40,limit:10},page:"5",pager:[0,1,2,3,4,5,6]}],fetch:{},mutations:void 0}}(800,670,1080,500,"2013-10-31T15:00:00.000Z","2022-01-09T00:08:54.444Z","2022-01-09T00:14:12.654Z","2022-01-09T00:15:47.342Z","2013-11-30T15:00:00.000Z","2022-01-09T00:37:16.473Z","2022-01-09T00:38:52.815Z","2013-12-31T15:00:00.000Z","2022-01-09T00:17:07.529Z","2022-01-09T00:19:05.000Z","2022-01-09T00:46:44.010Z","2022-01-09T00:20:11.617Z","2022-01-09T00:40:13.907Z","2022-01-09T00:41:28.198Z")));